function getMapInfo() {
    var result = []
    var info = mapInfo()
    for (var i = 0; i < info.articles.length; i++) {
        for (var j = 0; j < info.articles[i].reports.length;j++) {
            var disease = info.articles[i].reports[j].diseases[0]
            var location = info.articles[i].reports[j].locations[0].coords.split(', ')
            var lat = location[0]
            var lng = location[1]
            var date = info.articles[i].reports[j].event_date.split(' ')[0]
            var year = date.split('-')[2]
            var month = date.split('-')[1]
            var day = date.split('-')[0]
            date = year+'/'+month+'/'+day
            var text = info.articles[i].headline
            result.push({"disease": disease, "lat": lat, "lng": lng, "date": date, "text": text})
        }
    }
    return result
}

function getMapResult(result) {
    for (var i = 0; i < result.length; i++) {
        for (var j = 0; j < diseases.length; j++) {
            if (diseases[j].name === result[i].disease) {
                result[i].name = diseases[j].name
                result[i].type = diseases[j].type
                if (diseases[j].title) {
                    result[i].name = diseases[j].title
                }
                result[i].name = result[i].name.charAt(0).toUpperCase() + result[i].name.slice(1)
                break
            }
        }
    }
    return result
}

